INSERT INTO `school` (`id`, `uuid`, `name`, `desc`, `level`, `address`, `rector`, `phone`, `fax`, `web`, `email`, `kind`, `sort`, `image`, `time`) VALUES
(1, '11', '佳木斯市第六小学', '1962年更名为师范附小。1970年成立独立学校，该名为五七小学。1980年根据市教育局的统一要求，按建校时间顺序，正式定名为佳木斯市第六小学。建校以来，几代六小人薪火相传，不懈奋斗，走过了五十五年的风雨历程。在半个多世纪的历史画卷上写满了凝重与辉煌，积淀了丰富的文化底蕴，培养了大批优秀人才。', 0, '黑龙江省佳木斯市中山街211号', '张龙江', '0454-8223289', '0454-8223289', 'http://www.lxschool.net/', 'jialiuxiaoxue@163.com', 0, 99, '/upload/avatar/1409073481951.jpg', NULL),
(2, '12', '佳木斯市第一小学', '佳木斯市第一小学创建于1937年，在三江平原久负盛名，是省、市、区的窗口学校，素以锐意改革、勇于创新、教学扎实、校风好、质量优享誉省内外。 学校校舍总面积5950平方米，校园总面积14450平方米，全校6个年级，35个教学班，2300多名学生。学校设有仪器室、实验室、2个微机室、软件制作室、劳技室、舞蹈室、会议室、阅读室、卫生室、电教室等一系列完善设施。 学校拥有一支老、中、青结合的高素质师资队伍，各门教学均有学科带头人。中学高级老师占10%、青年教师均为大专以上学历，50%以上的青年教师成为学校教学骨干并以其出色的业绩获取了各级组织的表彰。 在区委、区政府的领导下，学校遵循“抓一流管理，保一流质量，建一流学校”的理念，体现人文关怀，情感育人是学校教育思想的特色。提倡每一个教师和学生都是学校的主人，都应该参与到校的建设和发展大计中来，提出了“学会赏识、爱满天下”的教育思想。教师工作“严谨、求实、勤奋、创新”，逐步形成了具有自身特色的教育教学管理体系。学校教育活动丰富多彩，教学质量明显提高，学校全面推进素质教育，取得了显著成效：学校先后被评为省“注·提”实验先进单位、省现代化教育技术实验学校、市级示范校，并获得市级文明单位标兵、市优秀少先队大队等荣誉，社会声望好。 全校师生正以饱满的精神，奋进的姿态，为把学校办成全国有影响、全省有位置、全市属一流的名校而不懈努力。', 0, '文久街与长安西路交汇处北行125米 ', '张淑杰', '0454-8228477', '0454-8228477', NULL, NULL, 0, 99, '/upload/avatar/1409456274744.jpg', NULL),
(3, '13', '佳木斯市第九小学', '佳木斯市第九小学始建于1956年，位于站前路与通江街交汇处。校园占地面积约7000平方米，现有24个教学班，在校学生1086人，教职工108人，学历达标率为100%。其中国家特级教师1人.省级骨干教师3人，市级骨干教师10人，区级骨干教师17人,向阳区名师4人。第九小学本着对社会负责，对学生人生负责的发展宗旨，审视过去、规划未来。确立了“张扬个性、和谐发展、习武益智、创建特色”的办学目标，以“创设适宜学生的教育，使校园成为学生成长的乐园”为办学理念，立“诚信、求美、自主、和谐”为校训，立“敬业、爱生、严谨、创新”为教风，立“主动、乐学、勤思、善问”为学风。在办学思想的鼓舞和指引下，学校的各项工作得到了健康、蓬勃的发展，早在1999年就被评为省级文明单位。近年来，学校先后被表彰为“全国红旗大队”、“省课改实验先进集体”、“省三育人先进集体”、“省卫生工作先进单位”、“省手拉手先进集体”、“省依法治校示范校”、“市示范性小学”、“市标准化小学”、“市艺术基点校”。2010年，作为全市唯一一所学校代表，迎接国家司法部全国五五普法检查验收，并受到高度赞誉。', 0, '龙江省佳木斯市向阳区通江街南段', '未知', '0454-8444416', '0454-8444416', NULL, NULL, 0, 98, '/upload/avatar/1409457244699.jpg', NULL),
(4, '14', '佳木斯雪松小学', '10月11日，雪松小学全体师生欢聚一堂，热烈庆祝中国少年先锋队的建队日，并隆重举行中国少年先锋队“第四届代表大会”。大会严格履行少先队代表大会程序，首先由少先队员献词，接着大队辅导员陈老师做上一届工作报告，然后是大队委员候选人竞选演讲，之后队员代表现场投票，从17名候选人中选举11人为少先队大队委员，先选举大队委员代表发表就职演说，学校就少先队员提案从校园环境设施方面、读书方面、食堂就餐方面、开展活动等方面做了详尽的解答，最后校长做总结发言。会议议程规范、民主，少代会充分体现了三个“我能”，即：我能参与管理，我能提供服务，我能自律自育，此次会议为中国少年先锋队建队64周年献礼。', 0, '黑龙江省佳木斯市东风区东风区长胜路29号', '未知', '0454-8377046', '0454-8377046', 'http://www.ruyile.com/school.aspx?id=90458', NULL, 0, 97, '/upload/avatar/1409457716182.jpg', NULL),
(5, '15', '富锦市第十二小学', '富锦市第十二小学始建于1991年，学校占地面积9390平方米，建筑面积5000余平方米。校内有五层办公楼、实验室和三层教学楼连接的综合楼。楼内设有标准化教室24个，实验室、图书室、卫生室、微机室、体育室、音乐室、多功能电教大厅等12个。普及五个居民委组，家庭子女的学前教育及小学教育。\r\n　　富锦市第十二小学具省级标准化，以“一切为了孩子的发展、一切适应孩子的发展、一切促进孩子的发展”为办学思想 。以“培养适应社会主义发展的创新人才，创办人民满意的现代化一流学校”为办学宗旨，以培养“德智双全、学识扎实、身心两健的创新人才”为办学目标，领导站在教育改革的高度，及广大师生的智慧，确立了“为了学生的终身发展奠基”的办学理念，实施新一轮课程改革实验，推进素质教育。学校被命为：全国小学生心理健康教育基地、省创新教育实验学校、佳市教育科研基地、佳市小学英语实验学校、支援西部教育基地。先后获得：佳市标兵大队部、佳市校务公开先进集体、省标准化小学、省教育科研先进集体、省冰雪活动先进集体、东北地区信息情报工作先进集体、全国教学改革先进集体、全国小学生心理健康教育先进集体、佳市示范小学、省一类学校、省文明单位等三百余项殊荣。 \r\n　　学生参加全国“双龙杯”书画大赛 、省作文大赛、“四小”作品展有四百多人次获奖。教师在各级刊物发表或获奖的论文仅 “十五”就有一百五十多篇，教师参加省级赛课获奖的有十人次之多。', 0, '黑龙江省佳木斯市富锦市东平路99号-111号', '于璟', '0454-8782157 ', '0454-8782157 ', NULL, NULL, 0, 96, '/upload/avatar/1409458025787.jpg', NULL),
(6, '16', '佳木斯市第二十小学', '佳木斯市第二十小学，始建于1965年，是市首批标准化小学，省“两全”学校，设有教学班51个，3000余名学生，教职员工135人。大本学历24人，大专学历75人。小学超高12人，小高41人。国家级骨干教师4人，省级骨干教师6人，市级骨干教师9人。省最佳教学能手6人，省教学能手12人。而且80%以上的教师上过省市级公开课，在省市区各级享有较高的声誉。学校50岁以上的教师16人，40-50岁的教师18人，30-40岁的教师38人，30岁以下的教师40人，全校教师的平均年龄是34岁。从年龄的分布情况看，二十小学是一个年青的、具有极大发展潜力的集体。我校拥有两栋外形美观，结构全理，宽敞明亮的教学楼。', 0, '黑龙江省佳木斯市向阳区保卫路途333号', '未知', '0454-8226613', '0454-8226613', NULL, NULL, 0, 95, '/upload/avatar/1409458255483.jpg', NULL);
